BEGIN TRANSACTION;
DROP TABLE IF EXISTS `species`;
DROP TABLE IF EXISTS `observations`;
DROP TABLE IF EXISTS `trees`;
DROP TABLE IF EXISTS `sites`;

CREATE TABLE IF NOT EXISTS `species` (
	`species_id`	nvarchar ( 4 ) NOT NULL,
	`species_name`	nvarchar ( 8 ),
	PRIMARY KEY(`species_id`)
);
CREATE TABLE IF NOT EXISTS `sites` (
	`site_id`	nvarchar ( 7 ) NOT NULL,
	`site_name`	nvarchar ( 52 ),
	`location`	nvarchar ( 13 ),
	`elevation`	nvarchar ( 5 ),
	`coordinates`	nvarchar ( 10 ),
	PRIMARY KEY(`site_id`)
);
CREATE TABLE IF NOT EXISTS `trees` (
	`tree_id`	nvarchar ( 7 ) NOT NULL,
	`species_id`	nvarchar ( 4 ) NOT NULL,
	`site_id`	nvarchar ( 4 ) NOT NULL,
	PRIMARY KEY(`tree_id`),
	FOREIGN KEY(`site_id`) REFERENCES `sites`(`site_id`),
	FOREIGN KEY(`species_id`) REFERENCES `species`(`species_id`)
);
CREATE TABLE IF NOT EXISTS `observations` (
	`observation_id`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`tree_id`	nvarchar ( 4 ) NOT NULL,
	`year`	int,
	`width`	int,
	FOREIGN KEY(`tree_id`) REFERENCES `trees`(`tree_id`)
);

COMMIT;
